import "./Menu.css";

import {useState} from 'react'
import Radio from '@material-ui/core/Radio'
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControl from '@material-ui/core/FormControl'
import FormControlLabel from '@material-ui/core/FormControlLabel'
import FormLabel from '@material-ui/core/FormLabel'


function Menu()
{
	const [nb_card, setNbCard] = useState(4);

	const handleChange = (event) => {
		setNbCard(event.target.value);
	  };
	return (
		<div class="extern">
			<div class="intern">
				<h2>Menu</h2>
				<FormControl component="fieldset">
					<FormLabel component="legend">Nombre de paires:</FormLabel>
					<RadioGroup aria-label="gender" name="gender1" value={nb_card} onChange={handleChange}>
						<FormControlLabel value="5" control={<Radio />} label="3" />
						<FormControlLabel value="4" control={<Radio />} label="4" />
						<FormControlLabel value="other" control={<Radio />} label="Other" />
					</RadioGroup>
				</FormControl>
			</div>
		</div>);	
}
export default Menu;
